"""On imagine qu'une particule d'air, initialement dans l'√©tat d'√©quilibre thermodynamique rep√©r√© par $A$, se d√©place verticalement et subit une d√©tente adiabatique et r√©versible. Le point d'√©tat de la particule de fluide suit la courbe adiabatique r√©versible.


*   Pour une ascension mod√©r√©e, la pression diminue et le graphe ci-dessus montre alors que la particule d'air se trouve √† une temp√©rature inf√©rieure √† celle de l'air environnant. Sa flottabilit√© est alors orient√©e vers le bas, elle retombe.
*   Pour une descente mod√©r√©e, la pression augmente et le graphe ci-dessus montre que la particule d'air se r√©chauffe, sa temp√©rature est sup√©rieure √† celle de l'air environnant, sa flottabilit√© est orient√©e vers le haut. Elle remonte.

On conclut que l'atmosph√®re est *stable* en $A$.

Il est maintenant pertinent de g√©n√©raliser cette √©tude en tout point de la courbe d'√©tat de l'atmosph√®re. On pr√©sente dans le paragraphe suivant la construction d'un diagramme particulier, l'√©magramme, qui permet de r√©pondre √† cette probl√©matique.

## L'√©magramme

L'√©tat thermodynamique d'une particule d'air est d√©crit par sa pression et sa temp√©rature. Or, dans l'atmosph√®re, la temp√©rature et la pression sont accessibles par la mesure (ballon sonde). On convient donc de construire un diagramme thermodynamique, appel√© **√©magramme**, o√π l'on porte la pression en ordonn√©e (le m√©t√©orologue associe cette coordonn√©e de pression √† un axe vertical o√π est port√©e l'altitude en raison de la d√©pendance univoque de la pression vis-√†-vis de l'altitude) et la temp√©rature en abscisse. On compl√®te ce diagramme par un r√©seau de courbes d'√©volution *adiabatique r√©versible* et par les mesures issues d'un sondage de l'atmosph√®re (cet ensemble de mesures constitue la *courbe d'√©tat* de l'atmosph√®re).

Sur un √©magramme, l'√©volution isobare d'une particule d'air se traduit par un d√©placement horizontal du point repr√©sentatif de l'√©tat d'√©quilibre thermodynamique de cette particule d'air, une √©volution isotherme par un d√©placement vertical de ce m√™me point et une √©volution adiabatique r√©versible par un d√©placement le long de la courbe adiabatique r√©versible passant par ce point.

Il est possible de construire des √©magrammes plus r√©alistes en tenant compte de la vapeur d'eau contenue dans l'atmosph√®re et de ses possibles changements d'√©tat. On choisit ici, par souci de simplicit√©, de construire avec Python un √©magramme pour une atmosph√®re s√®che (*i.e.* sans vapeur d'eau).

L'√©magramme est ensuite utilis√© pour juger de la stabilit√© de l'atmosph√®re repr√©sent√©e par sa courbe d'√©tat.
"""

# D√©finition d'un tableau avec les diff√©rentes valeurs de temp√©rature initiale au sol (T0) pour une adiabatique r√©versible donn√©e
