## Mise en forme du graphe
plt.axis([193,323,1013,50])             # on d√©finit les limites des axes
plt.ylabel(r"Pression (hPa)")           # on ajoute un label sur l'axe des ordonn√©es
plt.xlabel(r"Temp√©rature (K)")          # on ajoute un label sur l'axe des abscisses
plt.title("Emagramme simplifi√©")        # on ajoute un titre
