                            # au dernier avec une p√©riodicit√© p
Ps=P_sondage[::p]           # idem pour Ps
# on calcule ensuite le tableau qui contient les valeurs du gradient en utilisant des coupes des tableaux Ts et Ps (ce qui revient √† d√©caler les indices).
# Ts[2:] d√©signe le tableau Ts √† l'exclusion des 2 premiers √©l√©ments; Ts[:-2] d√©signe le tableau Ts priv√© de ces deux derniers √©l√©ments. La ligne de code 
# qui suit remplace avantageusement une boucle it√©rative.
GradT = -(Ts[2:]-Ts[:-2])/(Ps[2:]-Ps[:-2])*(M_a*g*Ps[1:-1])/(R*Ts[1:-1])
# On calcule ensuite le tableau des fr√©quences de Brunt-V√§is√§l√§ au carr√© et on trace le graphe.
Freq2_BV = (g/4*np.pi**2)*(GradT-Gamma_a)/Ts[1:-1]
plt.plot(Freq2_BV,Ps[1:-1]*1e-2)
plt.plot((0,0), (1013,50), 'r--')   # on place un axe vertical √† N^2=0
plt.axis([-1.e-3,2e-3,1013,50])
